        return (  
            <div>

                {/* <button onClick={this.props.theFunctions.start}>Start</button> */}
                {/* <button onClick={this.props.theFunctions.stop}>Stop</button>
                <button onClick={this.props.theFunctions.reset}>Reset</button>       */}
                {disappear} 

                <form>
                    <input checked id="q2y" name ="membership" type ="radio" value="1"></input>
                    <label for="q2y">Yes</label>
                    <input id="q2n" name="membership" type="radio" value="0"></input>
                    <label for="q2n">No</label>
                </form>

            </div>


        );
    }
}

export default Buttons ;
